function Body() {


  return (
    <div className='display-1'>
    <p>Number of URL's shortened</p>

    <a href="/home/view">
              <button class="btn btn-outline-success" type="button">List Of URL's Shortened</button>
              </a>
<input type='text'></input>
              <button class="btn btn-outline-success" type="submit" onClick={copy}>Copy</button>
    </div>

  );
}

export default Body;
